import React, { useState } from 'react';
import axios from 'axios';

function CreateTeam() {
  const [teamName, setTeamName] = useState('');

  const handleSubmit = async (event) => {
    event.preventDefault();
    try {
      const response = await axios.post('http://localhost:9000/createTeam', { team_name: teamName });
      console.log(response.data); // Handle success response
    } catch (error) {
      console.error('Error creating team:', error); // Handle error
    }
  };

  return (
    <div>
      <h2>Create Team</h2>
      <form onSubmit={handleSubmit}>
        <label>
          Team Name:
          <input type="text" value={teamName} onChange={(e) => setTeamName(e.target.value)} />
        </label>
        <br />
        <button type="submit">Create Team</button>
      </form>
      {/* Optional: You can provide navigation buttons here as well */}
      <Link to="/" style={buttonStyle}>Go back</Link>
      <Link to="/ThankYou" style={buttonStyle}>Thank You</Link>
    </div>
  );
}


export default CreateTeam;
